import * as React from 'react';
import Box from '@mui/material/Box';
import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Tooltip from '@mui/material/Tooltip';

export default function UserDashBoard() {

  return (
    <React.Fragment>
      <Box sx={{ display: 'flex', alignItems: 'center', textAlign: 'center' }}>
        <Typography sx={{ minWidth: 200 }}>Contact</Typography>
        <Typography sx={{ minWidth: 200 }}>Profile</Typography>
        <Typography sx={{ minWidth: 200 }}>Cart</Typography>
        <Typography sx={{ minWidth: 200 }}>Order History</Typography>
        <Typography sx={{ minWidth: 200 }}>Favourites</Typography>
        <Tooltip title="Account settings">
          <IconButton
            size="small"
            sx={{ ml: 2 }}
            aria-haspopup="true"
          >
            <Avatar sx={{ width: 32, height: 32 }}>M</Avatar>
          </IconButton>
        </Tooltip>
      </Box>
    </React.Fragment>
  );
}
